class Solution {
  int maxPartitionsAfterOperations(String s, int k) {
    int n = s.length;
    List<int> freq = List.filled(26, 0);
    int partitions = 0, distinct = 0, maxPartition = 0;

    for (int i = 0; i < n; ++i) {
      if (++freq[s.codeUnitAt(i) - 'a'.codeUnitAt(0)] == 1) ++distinct;
      if (distinct > k) {
        maxPartition = max(maxPartition, partitions);
        --freq[s.codeUnitAt(i) - 'a'.codeUnitAt(0)];
        --i; // Step back to reconsider this character in next partition
        partitions = 1;
        distinct = 1;
        freq.fillRange(0, 26, 0);
        freq[s.codeUnitAt(i) - 'a'.codeUnitAt(0)] = 1;
      } else {
        partitions = 1;
      }
    }

    return maxPartition + 1;
  }
}
